import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Dashboard.css";
import logo from "../assets/logo.png"; // Import the logo image
import placeholderImage from "../assets/placeholder.png"; // Example image for sections

const Dashboard = () => {
  const navigate = useNavigate();
  const [activeSection, setActiveSection] = useState("Dashboard");

  // Mock data for service requests
  const requests = [
    { id: 1, title: "System Upgrade", status: "Pending" },
    { id: 2, title: "Printer Issue", status: "Resolved" },
    { id: 3, title: "Network Downtime", status: "In Progress" },
    { id: 4, title: "Software Installation", status: "Pending" },
  ];

  // Handle navigation
  const handleSidebarClick = (section) => {
    setActiveSection(section);
  };

  // Function to log out
  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/");
  };

  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <div className="logo-container">
          <img src={logo} alt="Service Portal Logo" className="logo" />
        </div>
        <ul>
          <li
            className={activeSection === "Dashboard" ? "active" : ""}
            onClick={() => handleSidebarClick("Dashboard")}
          >
            Dashboard
          </li>
          <li
            className={activeSection === "Requests" ? "active" : ""}
            onClick={() => handleSidebarClick("Requests")}
          >
            Requests
          </li>
          <li
            className={activeSection === "Reports" ? "active" : ""}
            onClick={() => handleSidebarClick("Reports")}
          >
            Reports
          </li>
          <li
            className={activeSection === "Settings" ? "active" : ""}
            onClick={() => handleSidebarClick("Settings")}
          >
            Settings
          </li>
        </ul>
        <button className="logout-button" onClick={handleLogout}>
          Logout
        </button>
      </div>
      <div className="main-content">
        {activeSection === "Dashboard" && (
          <>
            <h1>Dashboard</h1>
            <div className="summary">
              <div className="summary-card">
                <h3>Total Requests</h3>
                <p>{requests.length}</p>
              </div>
              <div className="summary-card">
                <h3>Pending Requests</h3>
                <p>{requests.filter((req) => req.status === "Pending").length}</p>
              </div>
              <div className="summary-card">
                <h3>Resolved Requests</h3>
                <p>{requests.filter((req) => req.status === "Resolved").length}</p>
              </div>
            </div>
            <h2>Service Requests</h2>
            <div className="requests-grid">
              {requests.map((req) => (
                <div key={req.id} className="request-card">
                  <h3>{req.title}</h3>
                  <p>
                    Status:{" "}
                    <span
                      className={`status ${req.status.toLowerCase().replace(" ", "-")}`}
                    >
                      {req.status}
                    </span>
                  </p>
                </div>
              ))}
            </div>
          </>
        )}
        {activeSection === "Requests" && (
          <>
            <h1>Requests</h1>
            <img src={placeholderImage} alt="Requests Placeholder" className="large-image" />
            <p>Here, you can manage all your service requests.</p>
          </>
        )}
        {activeSection === "Reports" && (
          <>
            <h1>Reports</h1>
            <img src={placeholderImage} alt="Reports Placeholder" className="large-image" />
            <p>Analyze performance and track progress through detailed reports.</p>
          </>
        )}
        {activeSection === "Settings" && (
          <>
            <h1>Settings</h1>
            <img src={placeholderImage} alt="Settings Placeholder" className="large-image" />
            <p>Update your profile, configure system preferences, and more.</p>
          </>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
